import Layout from '../Components/Layout';

const About = () => (

    <Layout >
        <div className='About'>
            <h1>About page </h1>

            <p>Application to view and track projects</p>

            <p>Manage and track your projects.</p>
            <p>Insert your Work Breakdown schedule, tasks, and track your timeline throughout the life of the project.</p>
            <br/>
            <p>Navigate a simple to use interface and assign roles to each project team member.</p>

        </div>

    </Layout>

    );

    export default About;
